--------\r"," */\r","\r","define('NUM_BIG_BLOCK_DEPOT_BLOCKS_POS', 0x2c);\r","define('SMALL_BLOCK_DEPOT_BLOCK_POS', 0x3c);\r","define('ROOT_START_BLOCK_POS', 0x30);\r","define('BIG_BLOCK_SIZE', 0x200);\r","define('SMALL_BLOCK_SIZE', 0x40);\r","define('EXTENSION_BLOCK_POS', 0x44);\r","define('NUM_EXTENSION_BLOCK_POS', 0x48);\r","define('PROPERTY_STORAGE_BLOCK_SIZE', 0x80);\r","define('BIG_BLOCK_DEPOT_BLOCKS_POS', 0x4c);\r","define('SMALL_BLOCK_THRESHOLD', 0x1000);\r","// property storage offsets\r","define('SIZE_OF_NAME_POS', 0x40);\r","define('TYPE_POS', 0x42);\r","define('START_BLOCK_POS', 0x74);\r","define('SIZE_POS', 0x78);\r","define('IDENTIFIER_OLE', pack(\"CCCCCCCC\",0xd0,0xcf,0x11,0xe0,0xa1,0xb1,0x1a,0xe1));\r","\r","\r","function GetInt4d($data, $pos) {\r","\t$value = ord($data[$pos]) | (ord($data[$pos+1])\t\u003c\u003c 8) | (ord($data[$pos+2]) \u003c\u003c 16) | (ord($data[$pos+3]) \u003c\u003c 24);\r","\tif ($value\u003e=4294967294) {\r","\t\t$value=-2;\r","\t}\r","\treturn $value;\r","}\r","\r","// http://uk.php.net/manual/en/function.getdate.php\r","function gmgetdate($ts = null){\r","\t$k = array('seconds','minutes','hours','mday','wday','mon','year','yday','weekday','month',0);\r","\treturn(array_comb($k,explode(\":\",gmdate('s:i:G:j:w:n:Y:z:l:F:U',is_null($ts)?time():$ts))));\r","\t} \r","\r","// Added for PHP4 compatibility\r","function array_comb($array1, $array2) {\r","\t$out = array();\r","\tforeach ($array1 as $key =\u003e $value) {\r","\t\t$out[$value] = $array2[$key];\r","\t}\r","\treturn $out;\r","}\r","\r","function v($data,$pos) {\r","\treturn ord($data[$pos]) | ord($data[$pos+1])\u003c\u003c8;\r","}\r","\r","class OLERead {\r","\tvar $data = '';\r","\tfunction OLERead(){\t}\r","\r","\tfunction read($sFileName){\r","\t\t// check if file exist and is readable (Darko Miljanovic)\r","\t\tif(!is_readable($sFileName)) {\r","\t\t\t$this-\u003eerror = 1;\r","\t\t\treturn false;\r","\t\t}\r","\t\t$this-\u003edata = @file_get_contents($sFileName);\r","\t\tif (!$this-\u003edata) {\r","\t\t\t$this-\u003eerror = 1;\r","\t\t\treturn false;\r","   \t\t}\r","   \t\tif (substr($this-\u003edata, 0, 8) != IDENTIFIER_OLE) {\r","\t\t\t$this-\u003eerror = 1;\r","\t\t\treturn false;\r","   \t\t}\r","\t\t$this-\u003enumBigBlockDepotBlocks = GetInt4d($this-\u003edata, NUM_BIG_BLOCK_DEPOT_BLOCKS_POS);\r","\t\t$this-\u003esbdStartBlock = GetInt4d($this-\u003edata, SMALL_BLOCK_DEPOT_BLOCK_POS);\r","\t\t$this-\u003erootStartBlock = GetInt4d($this-\u003edata, ROOT_START_BLOCK_POS);\r","\t\t$this-\u003eextensionBlock = GetInt4d($this-\u003edata, EXTENSION_BLOCK_POS);\r","\t\t$this-\u003enumExtensionBlocks = GetInt4d($this-\u003edata, NUM_EXTENSION_BLOCK_POS);\r","\r","\t\t$bigBlockDepotBlocks = array();\r","\t\t$pos = BIG_BLOCK_DEPOT_BLOCKS_POS;\r","\t\t$bbdBlocks = $this-\u003enumBigBlockDepotBlocks;\r","\t\tif ($this-\u003enumExtensionBlocks != 0) {\r","\t\t\t$bbdBlocks = (BIG_BLOCK_SIZE - BIG_BLOCK_DEPOT_BLOCKS_POS)/4;\r","\t\t}\r","\r","\t\tfor ($i = 0; $i \u003c $bbdBlocks; $i++) {\r","\t\t\t$bigBlockDepotBlocks[$i] = GetInt4d($this-\u003edata, $pos);\r","\t\t\t$pos += 4;\r","\t\t}\r","\r","\r","\t\tfor ($j = 0; $j \u003c $this-\u003enumExtensionBlocks; $j++) {\r","\t\t\t$pos = ($this-\u003eextensionBlock + 1) * BIG_BLOCK_SIZE;\r","\t\t\t$blocksToRead = min($this-\u003enumBigBlockDepotBlocks - $bbdBlocks, BIG_BLOCK_SIZE / 4 - 1);\r","\r","\t\t\tfor ($i = $bbdBlocks; $i \u003c $bbdBlocks + $blocksToRead; $i++) {\r","\t\t\t\t$bigBlockDepotBlocks[$i] = GetInt4d($this-\u003edata, $pos);\r","\t\t\t\t$pos += 4;\r","\t\t\t}\r","\r","\t\t\t$bbdBlocks += $blocksToRead;\r","\t\t\tif ($bbdBlocks \u003c $this-\u003enumBigBlockDepotBlocks) {\r","\t\t\t\t$this-\u003eextensionBlock = GetInt4d($this-\u003edata, $pos);\r","\t\t\t}\r","\t\t}\r","\r","\t\t// readBigBlockDepot\r","\t\t$pos = 0;\r","\t\t$index = 0;\r","\t\t$this-\u003ebigBlockChain = array();\r","\r","\t\tfor ($i = 0; $i \u003c $this-\u003enumBigBlockDepotBlocks; $i++) {\r","\t\t\t$pos = ($bigBlockDepotBlocks[$i] + 1) * BIG_BLOCK_SIZE;\r","\t\t\t//echo \"pos = $pos\";\r","\t\t\tfor ($j = 0 ; $j \u003c BIG_BLOCK_SIZE / 4; $j++) {\r","\t\t\t\t$this-\u003ebigBlockChain[$index] = GetInt4d($this-\u003edata, $pos);\r","\t\t\t\t$pos += 4 ;\r","\t\t\t\t$index++;\r","\t\t\t}\r","\t\t}\r","\r","\t\t// readSmallBlockDepot();\r","\t\t$pos = 0;\r","\t\t$index = 0;\r","\t\t$sbdBlock = $this-\u003esbdStartBlock;\r","\t\t$this-\u003esmallBlockChain = array();\r","\r","\t\twhile ($sbdBlock != -2) {\r","\t\t  $pos = ($sbdBlock + 1) * BIG_BLOCK_SIZE;\r","\t\t  for ($j = 0; $j \u003c BIG_BLOCK_SIZE / 4; $j++) {\r","\t\t\t$this-\u003esmallBlockChain[$index] = GetInt4d($this-\u003edata, $pos);\r","\t\t\t$pos += 4;\r","\t\t\t$index++;\r","\t\t  }\r","\t\t  $sbdBlock = $this-\u003ebigBlockChain[$sbdBlock];\r","\t\t}\r","\r","\r","\t\t// readData(rootStartBlock)\r","\t\t$block = $this-\u003erootStartBlock;\r","\t\t$pos = 0;\r","\t\t$this-\u003eentry = $this-\u003e__readData($block);\r","\t\t$this-\u003e__readPropertySets();\r","\t}\r","\r","\tfunction __readData($bl) {\r","\t\t$block = $bl;\r","\t\t$pos = 0;\r","\t\t$data = '';\r","\t\twhile ($block != -2)  {\r","\t\t\t$pos = ($block + 1) * BIG_BLOCK_SIZE;\r","\t\t\t$data = $data.substr($this-\u003edata, $pos, BIG_BLOCK_SIZE);\r","\t\t\t$block = $this-\u003ebigBlockChain[$block];\r","\t\t}\r","\t\treturn $data;\r","\t }\r","\r","\tfunction __readPropertySets(){\r","\t\t$offset = 0;\r","\t\twhile ($offset \u003c strlen($this-\u003eentry)) {\r","\t\t\t$d = substr($this-\u003eentry, $offset, PROPERTY_STORAGE_BLOCK_SIZE);\r","\t\t\t$nameSize = ord($d[SIZE_OF_NAME_POS]) | (ord($d[SIZE_OF_NAME_POS+1]) \u003c\u003c 8);\r","\t\t\t$type = ord($d[TYPE_POS]);\r","\t\t\t$startBlock = GetInt4d($d, START_BLOCK_POS);\r","\t\t\t$size = GetInt4d($d, SIZE_POS);\r","\t\t\t$name = '';\r","\t\t\tfor ($i = 0; $i \u003c $nameSize ; $i++) {\r","\t\t\t\t$name .= $d[$i];\r","\t\t\t}\r","\t\t\t$name = str_replace(\"\\x00\", \"\", $name);\r","\t\t\t$this-\u003eprops[] = array (\r","\t\t\t\t'name' =\u003e $name,\r","\t\t\t\t'type' =\u003e $type,\r","\t\t\t\t'startBlock' =\u003e $startBlock,\r","\t\t\t\t'size' =\u003e $size);\r","\t\t\tif ((strtolower($name) == \"workbook\") || ( strtolower($name) == \"book\")) {\r","\t\t\t\t$this-\u003ewrkbook = count($this-\u003eprops) - 1;\r","\t\t\t}\r","\t\t\tif ($name == \"Root Entry\") {\r","\t\t\t\t$this-\u003erootentry = count($this-\u003eprops) - 1;\r","\t\t\t}\r","\t\t\t$offset += PROPERTY_STORAGE_BLOCK_SIZE;\r","\t\t}\r","\r","\t}\r","\r","\r","\tfunction getWorkBook(){\r","\t\tif ($this-\u003eprops[$this-\u003ewrkbook]['size'] \u003c SMALL_BLOCK_THRESHOLD){\r","\t\t\t$rootdata = $this-\u003e__readData($this-\u003eprops[$this-\u003erootentry]['startBlock']);\r","\t\t\t$streamData = '';\r","\t\t\t$block = $this-\u003eprops[$this-\u003ewrkbook]['startBlock'];\r","\t\t\t$pos = 0;\r","\t\t\twhile ($block != -2) {\r","\t  \t\t\t  $pos = $block * SMALL_BLOCK_SIZE;\r","\t\t\t\t  $streamData .= substr($rootdata, $pos, SMALL_BLOCK_SIZE);\r","\t\t\t\t  $block = $this-\u003esmallBlockChain[$block];\r","\t\t\t}\r","\t\t\treturn $streamData;\r","\t\t}else{\r","\t\t\t$numBlocks = $this-\u003eprops[$this-\u003ewrkbook]['size'] / BIG_BLOCK_SIZE;\r","\t\t\tif ($this-\u003eprops[$this-\u003ewrkbook]['size'] % BIG_BLOCK_SIZE != 0) {\r","\t\t\t\t$numBlocks++;\r","\t\t\t}\r","\r","\t\t\tif ($numBlocks == 0) return '';\r","\t\t\t$streamData = '';\r","\t\t\t$block = $this-\u003eprops[$this-\u003ewrkbook]['startBlock'];\r","\t\t\t$pos = 0;\r","\t\t\twhile ($block != -2) {\r","\t\t\t  $pos = ($block + 1) * BIG_BLOCK_SIZE;\r","\t\t\t  $streamData .= substr($this-\u003edata, $pos, BIG_BLOCK_SIZE);\r","\t\t\t  $block = $this-\u003ebigBlockChain[$block];\r","\t\t\t}\r","\t\t\treturn $streamData;\r","\t\t}\r","\t}\r","\r","}\r","\r","define('SPREADSHEET_EXCEL_READER_BIFF8',\t\t\t 0x600);\r","define('SPREADSHEET_EXCEL_READER_BIFF7',\t\t\t 0x500);\r","define('SPREADSHEET_EXCEL_READER_WORKBOOK